    public boolean isIsomorphic(String s, String t) {
        // Keep tracking of last index a character appeared at in each word separately
        int[] sflags = new int[256];
        int[] tflags = new int[256];

        // Converting to arrays, time accessing arrays, beats anything else
        char[] _s = s.toCharArray();
        char[] _t = t.toCharArray();

        //Initializing the index arrays with first character from each string (started off by 1, to avoid conflict with the default value of int[] which is zero
        sflags[_s[0]] = 1;
        tflags[_t[0]] = 1;

        //Looping over both strings and check if a character is already seen
        for (int i = 1; i < _s.length; i++) {
            if (sflags[_s[i]] > 0) {
                //if a character from the first string is already seen then we make sure that the corresponding character from the other string also appeared at the same position, otherwise they are not isomorphic
                if (tflags[_t[i]] != sflags[_s[i]]) {
                    return false;
                }
                //If a character from first string is not ever seen, then we also make sure the corresponding character from the other string is also never seen
            } else if (tflags[_t[i]] > 0) {
                return false;
            }

            //We simply keep track of the index they last appeard at
            sflags[_s[i]] = i + 1;
            tflags[_t[i]] = i + 1;
        }
        return true;
    }
